import { useEffect } from "react";

import styles from "./MenuHome.module.css";
import logo from "../image/logo.png";

function MenuHome() {
  function tamanhoTela() {
    const burguer = document.querySelector(`.${styles.burguer}`);
    const fechar = document.querySelector(`.${styles.fechado}`);
    const menu = document.querySelector(`.${styles.menu}`);
    const listaMenu = document.querySelector(`.${styles.lista_menu}`);

    // Verifica se todos os elementos existem antes de manipular
    if (burguer && fechar && menu && listaMenu) {
      if (window.innerWidth <= 1100) {
        burguer.classList.remove("giraCloseD");
        burguer.style.display = "block";
        menu.style.height = "0%";
        listaMenu.style.display = "none";
      } else {
        burguer.style.display = "none";
        fechar.style.display = "none";
        menu.style.height = "100px";
        menu.style.flexDirection = "row";
        listaMenu.style.display = "flex";
        listaMenu.style.opacity = 1;
      }
    }
  }

  useEffect(() => {
    window.addEventListener("resize", tamanhoTela);
    window.addEventListener("load", tamanhoTela);

    // Remove os event listeners ao desmontar o componente
    return () => {
      window.removeEventListener("resize", tamanhoTela);
      window.removeEventListener("load", tamanhoTela);
    };
  }, []);

  return (
    <nav className={styles.nav_menu}>
      <div id="header">
        <a href="#welcome">
          <img className={styles.img_logo} src={logo} alt="Likizoa" />
        </a>
        <svg className={styles.burguer} xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="24" height="24" color="#000000" fill="none">
          <path d="M4 5L20 5" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" />
          <path d="M4 12L20 12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" />
          <path d="M4 19L20 19" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" />
        </svg>
        <svg className={styles.fechado} xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="24" height="24" color="#ffffff" fill="none">
          <path d="M19.0005 4.99988L5.00049 18.9999M5.00049 4.99988L19.0005 18.9999" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" />
        </svg>
      </div>
      <menu className={styles.menu}>
        <ul className={styles.lista_menu}>
          <a href="#capa">
            <li className={styles.itens_menu}>In√≠cio</li>
          </a>
          <a href="#nossa_empresa">
            <li className={styles.itens_menu}>Nossa Empresa</li>
          </a>
          <a href="#parceiros">
            <li className={styles.itens_menu}>Parceiros</li>
          </a>
          <a href="#contatos">
            <li className={styles.itens_menu}>Contato</li>
          </a>
          <a href="#">
            <li className={styles.itens_menu}>teste</li>
          </a>
          <a href="/pages/login.html">
            <li className={styles.itens_menu}>Login</li>
          </a>
        </ul>
      </menu>
    </nav>
  );
}

export default MenuHome;
